class Solution:
    def findSubstring(self, s: str, words: list[str]) -> list[int]:
        concatStr = []
        result = []
        for elm in range(len(words)):
            print(elm)
            if (words[elm] in s):
                def allPossWords(strArray, rest=''):
                    if len(strArray) == 0:
                        concatStr.append(rest)
                        print(concatStr)
                    else:
                        for i in range(len(strArray)):
                            allPossWords(strArray[:i] + strArray[i + 1:], rest + strArray[i])

                apw = [allPossWords(words)]
                print(concatStr)
                uniqueConcatStr = list(set(concatStr))

                def findSameStrIndexs(longStr, str,):
                    repeatedStr = []
                    for i in range(len(longStr)):
                        if str in longStr[i:]:
                            repeatedStr += [(longStr.index(str, i))]
                    return list(set(repeatedStr))

                for strToFind in uniqueConcatStr:
                    result += findSameStrIndexs(s, strToFind)
            return result


