class Solution2:
    def findSubstring(self, s: str, words: list[str]) -> list[int]:
        res = []
        m,n,k = len(s), len(words), len(words[0])
        counter = collections.Counter(words)
        for i in range(k):
            temp = copy.deepcopy(counter)
            start = i
            for j in range(start, m-k+1, k):
                word = s[j:j+k]
                temp[word]-=1
                while temp[word] < 0:
                    temp[s[start:start+k]]+=1
                    start+=k
                if j+k-start==n*k:
                    res.append(start)
        return res

class Solution3:
    def findSubstring(self, s: str, words: list[str]) -> list[int]:
        # remove empty cases
        if not s or words == []:
            return []
        len_str = len(s)
        len_word = len(words[0])
        len_substr = len(words) * len_word

        # creating dict of number of apperance that should be in s for each word
        appearance = {}
        for word in words:
            appearance[word] = appearance[word] + 1 if word in appearance else 1

        res = []
        for str_start in range(min(len_word, len_str - len_substr + 1)):
            res += self.findAnswer(str_start, len_word, len_substr, s, appearance)
        return res

    def findAnswer(self, str_start, len_word, len_substr, s, appearance):
        word_start = str_start
        curr_appearance = {}
        res = []

        while str_start + len_substr <= len(s):
            word = s[word_start: word_start + len_word]
            word_start += len_word
            # if we encountered word that is not in words, start checking again
            if word not in appearance:
                str_start = word_start
                curr_appearance.clear()
            else:
                # add the word to the current appearance
                curr_appearance[word] = curr_appearance[word] + 1 if word in curr_appearance else 1

                # as long as this word appears in our counting more than it should,
                # update the substring to be one less word, until we reach to
                # this word (sub 1 from the count of the first word count again)
                while curr_appearance[word] > appearance[word]:
                    curr_appearance[s[str_start: str_start + len_word]] -= 1
                    str_start += len_word

                # if we handled the last word missing in substring - we found res!
                if word_start - str_start == len_substr:
                    res.append(str_start)
        return res


class Solution4:
    def findSubstring(self, s: str, words: list[str]) -> list[int]:
        solution = []
        wordslength = sum(len(w) for w in words)
        if ( wordslength > len(s)):
            print(solution)
            return solution
        else:
            for i in range(0,(len(s)-wordslength+1)):
                def findInndex(lst, indx = i):
                    for j in range(len(lst)):
                        if lst[j] == s[indx:(indx+(len(lst[j])))]:
                            new_list = lst[:j] + lst[j+1:]
                            if new_list == []:
                                return  i
                            return findInndex(new_list, indx+(len(lst[j])))
                if findInndex(words) != None:
                    solution.append(findInndex(words))
        print(solution)

